title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o16340.m5 -> o16321.m23 -> o16340.m5
  o16321.m23 -> o16340.m5 -> o16321.m23
  o16357.m24 -> o16335.m30 -> o16357.m24
  o16357.m11 -> o16335.m30 -> o16357.m24 -> o16335.m30
  o16335.m30 -> o16357.m24 -> o16335.m30
  o16335.m29 -> o16335.m30 -> o16357.m24 -> o16335.m30
  o16347.o16349.m3 -> o16356.m1 -> o16347.o16349.m3
  o16356.m1 -> o16347.o16349.m3 -> o16356.m1

features:
  - inheritance
  - overriding
  - method
  - polymorphism

